import React from "react";
import "./Chart.css";
import ChartBar from "./ChartBar";

const Chart = (props) => {
  <div className="chart">
    {props.datapoints.map((datapoint) => (
      <ChartBar
        key={datapoint.lable}
        value={datapoint.value}
        maxValue={null}
        lable={datapoint.lable}
      />
    ))}
  </div>;
};

export default Chart;
